package web_driver_practs;
import jxl.*;
import jxl.write.*;
import jxl.write.Number;
import java.io.File;
import java.io.IOException;

public class Above60 {


    public static void main(String[] args) {

    	try {
            Workbook workbook = Workbook.getWorkbook(new File("C:\\Users\\rasoo\\OneDrive\\Desktop\\stqa material\\output.xlsx"));
            Sheet sheet = workbook.getSheet(0);

            for (int col = 1; col  < sheet.getColumns(); col++) { // Assuming there are 3 subjects (adjust as needed)
                int count = 0;
                for (int row = 1; row < sheet.getRows(); row++) {
                    Cell cell = sheet.getCell(col, row);
                    int score = Integer.parseInt(cell.getContents());
                    if (score > 50) {
                        count++;
                    }
                }
                System.out.println("No of students scoring above 50 in Subject " + col + " = " + count);
            }
            workbook.close();
        } catch (Exception e) {
            e.printStackTrace();
        }

    }
}
